import React from "react";
import { Navbar, Nav, Row, Col, Container } from "react-bootstrap";
import { NavItem, NavIcon, NavText } from "@trendmicro/react-sidenav";
import "./index.css";
class Headbar extends React.Component {
  render() {
    return (
      <Navbar
        fixed="top"
        expand="lg"
        bg="dark"
        variant="dark"
        className="topnav"
      >
        <Container fluid="md" className="py-5">
          <NavItem>
            <NavIcon className="d-flex">
              <i
                className="fa fa-fw align-items-center"
                style={{ fontSize: "1.75em" }}
              />
              <img
                src={require("../assets/logo/logo.png")}
                width={35}
                height={35}
                alt="logo"
                style={{
                  paddingRight: "0.5em",
                }}
              />
              <text className="">
                Berkat Kawan Sakti Bersama <br />
                SIA
              </text>
            </NavIcon>
          </NavItem>
          <Nav.Item className="logo primary d-flex align-items-center">
            <div className="mr-4">
              <img
                src={require("../assets/logo/logo.png")}
                style={{ borderRadius: "10px" }}
                width="52px"
                height="52px"
                alt="profile"
              />
            </div>
          </Nav.Item>
          <Nav.Item className="d-none d-md-flex justify-content-between align-items-center">
            Berkat Kawan Sakti Bersama
            <div className="mr-4">
              <div className="text bold">name</div>
              <div className="small">+62 </div>
            </div>
          </Nav.Item>
        </Container>
        <Navbar.Brand href=""></Navbar.Brand>
      </Navbar>
    );
  }
}

export default Headbar;

